import datetime


def get_calendar_week(date_str):
    # Extract the date part from the input string
    date_part = date_str.split('-')[1].split('_')[0]

    # Convert the date part to a datetime object
    date = datetime.datetime.strptime(date_part, '%Y%m%d%H%M%S')

    # Get the calendar week of the date
    calendar_week = date.isocalendar()[1]

    return calendar_week


